import React from "react";
import styled from "styled-components";

const UserForm = styled.form`
  display: flex;
  flex-direction: column;
  max-width: 90%;
  margin: 0 auto;

    h2 {
        text-align: center;
    }

    label {
        padding: 5px 0;
    }

    input {
        outline: none;
    }
  .name {
    display: flex;
  }


`;

export default function SignUp({}) {
  return (
    <UserForm>
        <h2>Sign up to start writing your first nuanced note!</h2>
      <div className="name">
        <div className="firstname">
          <label htmlFor="firstName" name="firstName" id="firstName" required>
            First Name
          </label>
          <input type="text" />
        </div>
        <div className="lastname">
          <label htmlFor="lastName" name="lastName" id="lastName" required>
            Last Name
          </label>
          <input type="text" />
        </div>
      </div>
      <label htmlFor="userName" name="userName" id="userName" required>
        User Name
      </label>
      <input type="text" />
      <label htmlFor="email">Email </label>
      <input type="email" name="email" id="email" required />
      <label htmlFor="password">Password </label>
      <input type="password" name="password" id="password" required />
      <label htmlFor="password">Confirm Password </label>
      <input type="password" name="password" id="confirmPassword" required />
      <UserFormBtn type="submit" name="signup">
        Sign Up
      </UserFormBtn>

    </UserForm>
  );
}
